  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Izembek, Eastern
  Aleutians, Semidi, and Simeonof NWRs outlines Refuge accomplishments during the
  1977 calendar year. The report begins with an introduction to the Refuge and information
  about weather conditions, habitat conditions, and the system status. Construction
  and maintenance are also described. Habitat management is covered; wetlands are
  discussed. The wildlife section of the report discusses endangered and threatened
  species, migratory birds, mammals, non-migratory birds, and brown bears. Interpretation
  and recreation activities are outlined; topics include information and interpretation,
  recreation, and law enforcement. Field investigations, cooperative programs, and
  items of interest are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
